import React from "react";
import './neumorphicLightSwitch.css';

const NeumorphicLightSwitch = () => {
	return (
		<div className="demo">
			<h1>NEUMORPHIC LIGHT SWITCH</h1>
			<form>
				<input type="range" />
			</form>
		</div>
	);
};

export default NeumorphicLightSwitch;
